import { Fragment } from "react";
import { Link } from "react-router-dom";
import EventsList from "../components/EventsList";

let DUMMY_EVENTS = [
  { date: 12, title: "Event 1", id: "E1" },
  { date: 12, title: "Event 2", id: "E2" },
  { date: 12, title: "Event 3", id: "E3" },
];

let Events = () => {
  return (
    <Fragment>
      <h1>Events</h1>
      <EventsList events={DUMMY_EVENTS} />
    </Fragment>
  );
};

export default Events;

export const loaderEvents = async () => {
  let request = await fetch("http://  ");
};
